import { logout } from "./ts/staticFunctions";

interface Props {
    is_authenticated: boolean | undefined;
    homeDisplay(): void,
    newDisplay(): void,
    loginDisplay(): void,
    registerDisplay(): void
}
export default function Navbar(props: Props){
    const {is_authenticated} = props
    function Nav(){
        if (is_authenticated && !is_authenticated){
            return(
                <div className="content-container-nav">
                    <div className="center-flex">
                        <div className="nav-link-custom cursor-pointer" id="home" onClick={props.homeDisplay}>Home</div>
                        {is_authenticated && <div className="nav-link-custom cursor-pointer" onClick={props.newDisplay} >New Quiz</div>}
                    </div>
                    <div className="center-flex">
                        <div className="nav-link-custom">
                            {!is_authenticated && <>
                            </>}
                            <a className="nav-link-custom cursor-pointer" id="logout" href="/" onClick={logout}>Log Out</a>
                        </div>
                    </div>
                </div>
            )
        }
        else if (is_authenticated===false){
            return(
                <div className="content-container-nav">
                    <div className="center-flex">
                        <div className="nav-link-custom cursor-pointer" onClick={props.homeDisplay}>Home</div>
                    </div>

                    <div className="center-flex">
                        <div  className="nav-link-custom">
                            <div className="nav-link-custom cursor-pointer"  onClick={props.loginDisplay}>Log In</div>
                        </div>
                        <div className="nav-link-custom">
                            <div className="nav-link-custom cursor-pointer"  onClick={props.registerDisplay}>Register</div>
                        </div>
                    </div>
                </div>
            )
        }
        else{
            return <></>
        }
    }
    return (
        <div className="navbar-custom">
            <Nav />
        </div>
    )
    
}
